def main():
  # sample data for TX
  input_dates, input_locations, geo_types, data_matrix, nowcast_dates = \
    json.loads(
      zlib.decompress(
        base64.b85decode(
          data.replace('\n', '').encode('utf-8')
        )
      ).decode('utf-8')
    )
  data_matrix = np.array(data_matrix)

  # indicators to use as signals (to be turned into sensors)
  indicators = [
    ('fb-survey', 'smoothed_hh_cmnty_cli'),
    ('doctor-visits', 'smoothed_adj_cli'),
  ]

  # give dates, locations, indicators, and ground truth; get a nowcast
  # requires files:
  #   data/fips_msa_table.csv
  #   data/fips_state_table.csv
  # generates cache files like:
  #   data/cache/fusion.json
  #   data/cache/statespace-*.npy
  # will be slow for the first run, but repeated runs should be significantly
  # faster
  mean, stdev, locations = nowcast(
      input_dates,
      input_locations,
      geo_types,
      data_matrix,
      nowcast_dates,
      indicators)

  # print the nowcast
  for (loc, geo), nc, std in zip(locations, mean, stdev):
    print('%6s %5s %.1f (+/- %.1f)' % (geo, loc, nc, std))


if __name__ == '__main__':
  main()
